import React from 'react';
import { Card, CardContent, CardMedia, Typography, Grid,Button } from '@mui/material';
import image from './images.jpg'
import image2 from './download.jpg'

const PatientCard = ({ name, dob, disease, value, image }) => {
  return (
    
    <Card sx={{ maxWidth: 545 }} style={{height:"500px",width:"700px",marginLeft:"600px",background:"pink",paddingTop:"20px",marginTop:"100px",paddingLeft:"20px",border:"2px solid"}}>
      <Grid container>
        <Grid item xs={4}>
          <CardMedia
            component="img"
            height="200"
            image={image2}
            alt={name}
            border="2px black solid"
            borderRadius=""
          />
        </Grid>
        <Grid item xs={8}>
          <CardContent style={{marginLeft:"70px"}}>
            <Typography gutterBottom variant="h3" component="div">
              {name}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Date of Birth: {dob}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Disease: {disease}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Value: {value}
            </Typography>
            <Button style={{color:"black",marginTop:"200px",marginLeft:"100px"}} variant='contained'>Prescripition</Button>
            
          </CardContent>
        </Grid>
        
      </Grid>
    </Card>
   
  );
};

const LandingPage = () => {
  return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} md={4}>
          <PatientCard
            name="John Doe"
            dob="01/01/1990"
            disease="Flu"
            value="Normal"
            image="https://via.placeholder.com/150"
          />
          
        </Grid>
       
        {/* Add more PatientCard components as needed */}
      </Grid>
     
      
    </div>
  );
};

export default LandingPage;
